import React from "react"

const Navbar = (props) =>{
    //const response = props.response.data;
    //const data =  props.res.result;
    console.log(props)
    let count_AC=0;
    for(let i=0;i<props.res.length;i++){
      if(props.res[i].verdict==="OK"){
        count_AC+=1;
      }
    }
    console.log(count_AC);
    
    return(
        <div>
            <h1>AC: {count_AC}</h1>
        </div>
    )



}

export default Navbar
